import Home from "../components/home/Home";
import AddTodo from "../components/add-todo/AddTodo";

function App() {
  const [loggedIn, setIsLoggeIn] = useState(true);


  if (loggedIn === false){
    return (
    <Login setIsLoggeIn={setIsLoggeIn}/>
